import React from 'react'

function Result(props) {
  return (
    <div>
        <p>Hi {props.Name}. Wir haben deine Bestellung erhalten</p>
        <p>Hamburger :{props.Hamburger}</p>
        <p>Cola :{props.Cola}</p>
        <p>Eis :{props.Eis}</p>
    </div>
  )
}

export default Result;
